import './App.css';
import logo from './icons/icon.png';

import Header from './components/Header';
import Footer from './components/Footer';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { Button, CardActionArea, CardActions } from '@mui/material';

function App() {
  const name = "Sam Jherwin Tagufa";
  return (
    <div className="App">
      <Header />
      <main>
        <img src={logo} alt="Icon representing [insert description here]" />
        <h1>Hello, I'm {name}</h1>
        <button>Continue</button>
        <div className='container-div'>
        <Card sx={{ maxWidth: 345 }}>
      <CardActionArea>
        <CardMedia
          component="img"
          height="140"
          image="src/icons/education.jpg"
          alt="Icon representing [insert description here]"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="div">
            EDUCATION
          </Typography>
          <Typography variant="body2" color="text.secondary">
            I am now a 4th year BS Information Technology student in Laguna State Polytechnic University
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="primary">
          Share
        </Button>
      </CardActions>
    </Card>
        </div>
      </main>
      <Footer />
    </div>
  );
}

export default App;
